// 24 Ñ… 24
const Ico = ({ variant, color, size = 24, baseSize = 24, className }) => {
    variant = variant.split('/');
    color = (color === 'sport') ?  getCssColor(variant[1]) : 
        (color && color !== 'sport') ? getCssColor(color) :
            getCssColor('700');

    return (
        <svg className={className} width={size} height={size} viewBox={`0 0 ${baseSize} ${baseSize}`} fill="none" xmlns="http://www.w3.org/2000/svg">
            {icons(color)[variant[0]][variant[1]]}
        </svg>
    )
    
}
export {Ico}
